import { io } from 'socket.io-client'
import React from 'react'
import PropTypes from 'prop-types';
import { useState } from 'react';
import BlitzBoutLobby from './BlitzBoutLobby'
import { useNavigate } from "react-router-dom";
import BlitzBoutLeaderboard from './BlitzBoutLeaderboard';
import BlitzBoutQuestion from './BlitzBoutQuestion';
import BlitzBoutAnswers from './BlitzBoutAnswers';

const socket = io.connect('http://localhost:8080')

const BlitzBoutPlay = ({ email, gameKey, setGameKey, token, setErrorMsg }) => {

    const [gameState, setGameState] = useState("lobby");
    const [questionData, setQuestionData] = useState({});
    const [answerData, setAnswerData] = useState({});
    const [answersData, setAnswersData] = useState({});
    const [userAnswer, setUserAnswer] = useState({});
    const [questionState, setQuestionState] = useState("answered");
    const [leaderboardData, setLeaderboardData] = useState([]);
    const [score, setScore] = useState(0);
    const [answerScore, setAnswerScore] = useState(0);
    const [users, setUsers] = useState([]);
    const [gameName, setGameName] = useState("default");
    const navigate = useNavigate();

    React.useEffect(() => {

        const authObject = {
            email: email,
            gameKey: gameKey,
            token: token
        };

        socket.emit("joinGame", authObject)

        socket.on("updatePlayers", (data) => {
            setUsers(data)
            console.log("new user state")
        })

        socket.on("questionData", (data) => {
            setQuestionData(data)
            console.log("new question")
        })

        socket.on("questionState", (data) => {
            setQuestionState(data)
            console.log("new question state")
        })

        socket.on("leaderboardData", (data) => {
            setLeaderboardData(data)
            console.log("new leaderboard")
        })

        socket.on("gameState", (data) => {
            setGameState(data)
            console.log("new gamestate")
        })

        socket.on("gameName", (data) => {
            setGameName(data)
            console.log("new gameName")
        })

        socket.on("answerData", (data) => {
            setAnswerData(data)
            console.log("new answer data")
        })

        socket.on("AnswersData", (data) => {
            setAnswersData(data)
            console.log("new answers data")

            const answerIndex = answersData.findIndex((element) => element.email===email)
            setAnswerScore(answersData[answerIndex].points)
            setUserAnswer(answersData[answerIndex].answer)
            setScore(answersData[answerIndex].score)
        })

        socket.on("disconnection", (data) => {
            setGameKey("");
            console.log("hi3")
        })

        socket.on("joinFail", (data) => {
            navigate("/games/BlitzBout/join")
            console.log(data)
        })

        socket.on("error", (data) => {
            setErrorMsg(data + ":" + Date())
            console.log("new error")
        })

        socket.on("connect_error", (err) => {
            console.log(`connect_error due to ${err.message}`);
        });

        socket.on("kicked", (data) => {
            navigate("/games/BlitzBout/join")
            console.log(data);
        });

    }, [email, gameKey, setGameKey, navigate, token, setErrorMsg])

    const newAnswer = (userAnswer) => {

        const sendObject = {
            email: email,
            gameKey: gameKey,
            token: token,
            answer: userAnswer
        };

        socket.emit("newAnswer", sendObject)
    }


    switch (gameState) {
        case "":
            return <BlitzBoutLobby users={users} gameKey={gameKey} gameName={gameName} />
        case "lobby":
            return <BlitzBoutLobby users={users} gameKey={gameKey} gameName={gameName} />
        case "question":
            return <BlitzBoutQuestion users={users} gameKey={gameKey} gameName={gameName} questionData={questionData} questionState={questionState} newAnswer={newAnswer} />
        case "leaderboard":
            return <BlitzBoutLeaderboard users={users} gameKey={gameKey} gameName={gameName} leaderboardData={leaderboardData} />
        case "finalLeaderboard":
            return <BlitzBoutLeaderboard users={users} gameKey={gameKey} gameName={gameName} leaderboardData={leaderboardData} />
        case "answers":
            return <BlitzBoutAnswers gameKey={gameKey} gameName={gameName} answerData={answerData} answerScore={answerScore} score={score} userAnswer={userAnswer}/>
        default:
            return navigate("/games/BlitzBout/join")
    }

};
BlitzBoutPlay.propTypes = {
    email: PropTypes.string,
    gameKey: PropTypes.string,
    setGameKey: PropTypes.func,
    token: PropTypes.string,
    setErrorMsg: PropTypes.func
}

export default BlitzBoutPlay;
